  function counterPlus(el) {
      var val = $(el).closest('.kss_counter').find('.kss_body').text();
      $(el).closest('.kss_counter').find('.kss_body').text(+val + 1);
      if(+val + 1 >= 1) $(el).closest('.kss_counter').addClass('active');
      else $(el).closest('.kss_counter').removeClass('active');
      calcPrice2();
  }

  function counterMinus(el) {
      var val = $(el).closest('.kss_counter').find('.kss_body').text();
      if(!+val) val = 0;
      else val = val - 1;
      $(el).closest('.kss_counter').find('.kss_body').text(val);
      if(val >= 1) $(el).closest('.kss_counter').addClass('active');
      else $(el).closest('.kss_counter').removeClass('active');
      calcPrice2();
  }


